We are so excited to introduce Mari and her beautiful family, as we celebrate Asian American Pacific Islander Heritage Month.

“What a privilege it has been to share and celebrate my culture and where I come from. Both my Asian heritage and my upbringing in Hawai'i are a huge source of pride and make up so much of who I am and what is important to my family. Ask us about our culture, we love to share! Thank you, Baby Bling for always celebrating the diversity within our bow community.”

-Mari Uchima @_mar808_ 

